import React from "react";
import lodgingData from "../../data/lodging.json"; // Importez les données depuis le fichier JSON

function Tags() {
  const tags = lodgingData.tags.map((element, index) => (
    <p className='tagLodging' key={"tagsLodg-" + index}> {element}</p>
  ));

  return (
    <div className="TagsElement">
      {tags}
    </div>
  );
}

export default Tags;
